import React from 'react';

const FeedBackItem = ({rating,text}) => {
  return (
      <>
      <Card>
          
      </Card>
        <li className='feedbackItem'>
      <div className='rating'>{rating}</div>
      <div className='item'>{text}</div>
      </li>
      </>
    
  )
};

export default FeedBackItem;
